INSERT INTO "public"."idee" (id,nom,description) VALUES (1363,'eve de meiko','la femme guerrière qui a tellement mis son corps à l''épreuve qu''elle est devenu infertilernrnsuite à un coup au ventre, elle est devenu infertile, mais finit par arriver d''avoir une fille.rn');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1364,'lilith de lust','la femme de religion si pure mais elle subit un viol et garde enfant qu''elle met au monde malgré toutrnrnA l''enfance, l''enfant tente de la tuer.rnrnElle fera un vrai déni sur le fait que l''enfant essaie de la tuer et pense qu''il restera du bon cotérnrnIl finira par y arriver et la tuera sauvagementrn');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1365,'lilith de greed','la femme si belle que tout les hommes voulaient la prendre pour épousernrnelle pris le plus pauvre mais le plus gentil des maris sur cette longue listernrnd''un amour passionné, elle aura un enfant dès la première tentativernrnmais la femme meurt pendant l''accouchement, bizarrement la femme est tout lacéré de l''intérieur');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1366,'lilith de envy','la femme qui a toujours désiré avoir un enfant,rndepuis son enfance, elle voulait être une mère parfaiternrnLa femme met au monde le bébé, sauf qu''elle se suicide juste après juste en regardant profondément le bébé dans les yeux,rnelle y a vu le démon en lui, ne supportant pas d''avoir mis au monde un tel enfant, elle voulut le tuer mais impossiblernDonc elle se suicida');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1367,'lilith de glutonny','la femme si généreuse qui nourrissaient les enfants du quartier malgré qu''elle ne soit pas si richernrnelle finit par tomber sur l''homme idéal et attend un enfantrnrnsauf que la femme meurt à quelques jours du terme, mais le bébé qui survi en se nourrissant du cadavre.rnrnOn a retrouvé cet enfant 4 jours après la mort de sa mère, elle était partiellement dévoré.');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1368,'lilith de wrath','la femme d''une droiture exemplaire , forte et indépendante rnrnelle fait un enfant par procréation assistérnrnLa femme met au monde le bébé, tout va bien jusqu''à ce que l''enfant atteint l''adolescencernIl est méchant, horrible => bref, il fait peur à ses parents rnrndans un excès de colère, il tue ses parentsrnrn');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1369,'lilith de sloth','la femme la plus maternelle possible met au monde l''enfant maléfique, il grandit jusqu''à devenir adulte, une fois la maturité, il leur fait savoir que maintenant qu''il n''a plus besoin de euxrnIls n''ont plus aucune utilité, il est apte à reprendre ce qui lui appartient rnIl les tue dans l''indifférence la plus totale, comme s''il exécutait un esclave ou un animal d''élevage');
INSERT INTO "public"."idee" (id,nom,description) VALUES (1370,'lilith de pride','la femme qui adore par dessus tout les enfants mais qui a bien compris que son enfant était le mal incarné,  mais qui accepte ce fait et lui donne ce qu''il veut, c''est à dire des cotés nefastes');
