INSERT INTO "public"."idee" (id,nom,description) VALUES (1372,'eve de maya','la femme qui tellement été égoiste qu''elle n''a jamais pu avoir d''enfant, maintenant il est trop tardrnrnmais malgré la vieillesse, elle tomba enceintern');
